import React from "react";

export class ListItem extends React.Component {
  render() {
    const {
      by,
      descendants,
      id,
      kids,
      score,
      time,
      title,
      type,
      url,
    } = this.props;

    return (
      <div className="Item">
        <h2 className="itemTitle">{title}</h2>
        <div className="domain">{url}</div>
        <div className="info">
          <div>{score} points</div>
        </div>
      </div>
    );
  }
}
